htmlEscape.haxe_doc:
Escapes HTML special characters of the string `s`.

		The following replacements are made:

		- `&` becomes `&amp`;
		- `<` becomes `&lt`;
		- `>` becomes `&gt`;

		If `quotes` is true, the following characters are also replaced:

		- `"` becomes `&quot`;
		- `'` becomes `&#039`;

run.haxe_doc:
This method is invoked repeatedly on `this` Timer.
It can be overridden in a subclass, or rebound directly to a custom function: var timer = new haxe.Timer(1000); // 1000ms delay timer.run = function() { ... }
Once bound, it can still be rebound to different functions until `this` Timer is stopped through a call to `this.stop`.

class.haxe_doc:
General purpose multi-state button control with icon and toggle support (plus icon positioning)

 <b>Code Example</b>
 <pre>
 var button:Button = new Button();
 button.x = 100;
 button.y = 100;
 button.width = 150;
 button.height = 100;
 button.text = "Button";
 button.id = "theButton";</pre>

 <b>XML Example</b>
 <pre>
 &lt;button id="theButton" text="Button" x="100" y="100" width="150" height="100" /&gt;</pre>

loadBitmapData.haxe_doc:
* Asynchronously loads an instance of an embeded bitmap
	 * @usage 	Asset.loadBitmapData("MyReallyBigPic.jpg", function(_loadedBitmapData):Void{
	 * 				var myReallyBigBitmap = new Bitmap(_loadedBitmapData);
	 * 			});
	 * @param	id 		The ID or asset path for the file
	 * @param	handler	a funtion to handle the loaded BitmapData
	 * @param	useCache whether or not to add / retrieve the asset from the cache

